require 'fix_engine'

require 'test/unit'

class FixMessageTest < Test::Unit::TestCase
	def test_initialize()
		assert_raise( ArgumentError ) { FIX::Message.new }
		session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
		assert_raise( ArgumentError ) { FIX::Message.new( session ) }
		assert_nothing_raised( ArgumentError ) { FIX::Message.new( session, "Logon" ) }
	end
	def test_to_s
		session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
		assert_raise( RuntimeError ) { FIX::Message.new( session, "Logon" ).to_s }
		session.properties[ 'SenderCompID' ] = "TestSender"
		assert_raise( RuntimeError ) { FIX::Message.new( session, "Logon" ).to_s }
		session.properties[ 'TargetCompID' ] = "TestTarget"
		assert_raise( RuntimeError ) { FIX::Message.new( session, "Logon" ).to_s }
		session.properties[ 'EncryptMethod' ] = "0"
		assert_raise( RuntimeError ) { FIX::Message.new( session, "Logon" ).to_s }
		session.properties[ 'HeartBtInt' ] = "60"
		assert_nothing_raised( nil ){ FIX::Message.new( session, "Logon" ).to_s }
		assert_equal( /49=TestSender/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /56=TestTarget/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /8=FIX.4.2/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /35=A/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /34=1/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /52=\d{8}-\d{2}:\d{2}:\d{2}\.\d{3}/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /98=0/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /108=60/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /10=\d{3}/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, false )
		assert_equal( /77=\d{3}/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, true )
		assert_equal( /77=\d{3}/.match( FIX::Message.new( session, "Logon", { "77" => "234" } ).to_s ) == nil, false )
	end
	def test_add_field
		session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
		session.properties[ 'SenderCompID' ] = "TestSender"
		session.properties[ 'TargetCompID' ] = "TestTarget"
		session.properties[ 'EncryptMethod' ] = "0"
		session.properties[ 'HeartBtInt' ] = "60"
		assert_equal( /452=hello/.match( FIX::Message.new( session, "Logon" ).to_s ) == nil, true )
		assert_equal( /452=hello/.match( FIX::Message.new( session, "Logon" ).add_field( "452", "hello" ).to_s ) == nil, false )
	end
	def test_msg_body
		session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
		session.properties[ 'SenderCompID' ] = "TestSender"
		session.properties[ 'TargetCompID' ] = "TestTarget"
		session.properties[ 'EncryptMethod' ] = "0"
		session.properties[ 'HeartBtInt' ] = "60"
		assert_equal( FIX::Message.new( session, "Logon" ).send( :msg_body ), "#{1.chr}35=A#{1.chr}" )
		assert_equal( FIX::Message.new( session, "Logon", { '118' => 'full', '119' => 'test' } ).send( :msg_body ), "#{1.chr}35=A#{1.chr}118=full#{1.chr}119=test" )
	end
