	def test_msg_to_string
		session = FIX::Session.new("FIX.4.2", "etc/FIX42.xml")
		session.properties[ 'SenderCompID' ] = "TestSender"
		session.properties[ 'TargetCompID' ] = "TestTarget"
		session.properties[ 'EncryptMethod' ] = "0"
		session.properties[ 'HeartBtInt' ] = "60"
		assert_equal( FIX::Message.new( session, "Logon" ).add_field( "444", "555" ).send( :msg_to_string ), "8=FIX.4.2#{1.chr}9=13#{1.chr}35=A#{1.chr}444=555#{1.chr}10=090#{1.chr}" )
		assert_equal( FIX::Message.new( session, "Logon" ).add_field( "444", "555" ).add_field( "654", "world" ).send( :msg_to_string ), "8=FIX.4.2#{1.chr}9=23#{1.chr}35=A#{1.chr}444=555#{1.chr}654=world#{1.chr}10=096#{1.chr}" )
	end
